    Description: 'Melting Rain\r\n\r\nLinks\r\n\r\nIn the seventh grade Brenden Blackham was obsessed with starting a rock band worthy of fame and glory. In the process of finding musicians in a small town middle school, he stumbled upon an adequate guitarist by the name of Brantly Green. The two talked and hung out for a while and decided they had the same dream: To find a drummer, change the world, and make amazing music. In that awkward and ever so memorable process, they met the small but hilariously funny and ravishing young specimen that is Gavin Cox, who said he knew how to play drums. In a very quick exchange of words they decided to meet at Brenden\'s house to rehearse. On a common after-school day, Gavin and Brantly both showed up with guitars in hand, and Brenden just showed up. After about ten minutes, to Brenden and Brantlys\' astonishment, they found out that Gavin had no friggin idea how to play the drums...at all. So considering the fact that he was the best looking of the three of them, they could not get rid of him. So instead of kicking Gavin out, they gave him a bass guitar, Brenden swapped to drums, Brantly never changed, and Melting Rain was born. The line-up has been consistent since then with slight changes between the three moving from drums to bass to guitar. The trio has been playing together since September 2011 and they now consider each other like brothers.',
