    Description: 'Salt Lake City\'s prodigal son returns for ONE NIGHT ONLY! Six years ago Sina left SLC, his friends and family to chase a bigger piece of that American Pie. Known locally for being the foreign guy Nader in the runaway Halestorm hit Church Ball and the guy who made you think twice before swimming in public pools from his No Crypto Utah PSA, Sina decided to swing for the big pinata and head to the gold coast. In that time he\'s won Best of the Fest at the San Luis Obispo Comedy Festival and been featured in the Middle Eastern Comedy Festival as well as the Burbank Comedy Festival. He\'s landed roles on TNT\'s Southland and ABC\'s FlashForward. Then he returned to Utah like MacArthur to the Philippines with his huge Sundance hit, Circumstance, which won the Audience Award at the festival and got him nominated for an Independent Spirit Award. Must Be 21 or Over With Valid ID.\r\n\r\n*   21+ Show -',
