    Description: '"The Future Is Now" is the latest album by singer/songwriter, John Louviere, and, by far, his best to date.  The album was produced by multi-instrumentalist, collaborator, and recording engineer Andrew Goldring at Soundcave Studios in Salt Lake City, Utah (http://soundcavestudio.com/).  Louviere seems to have found a a sweet spot in his collaboration with Goldring, as there are no misses on this fine album.  True to form, though, his brand of heartache matched with his understated, emotional, and melodic delivery continues to be as unique as it is beautiful.\r\n___\r\n\r\n___\r\n\r\n21 and over',
