    DateStart: '2016-10-20T21:00:00Z',
    Description: 'You dreamed of it..and now you can LIVE it!  Be the LEAD SINGER of a Live Band with This Is Your Band (TIYB), playing here every Thursday night!  This IS the ONLY Live Band Karaoke in Utah...and once you experience it, you\'ll never look at Karaoke the same!  They have over 1000 songs to choose from - to view their list, go to thisisyourband.com and download their songlist!  Arrive early to get on the list...it fills up fast and we want to hear YOU sing!  Come early and enjoy one of our delicious dinner entrees and your favorite beverages all night long!  This event is SOOOOO popular that the LIST fills up fast, and we want as many of you to be able to sing every Thursday as possible, so please review the following so we can get as many of you up on stage as possible and to avoid any confusion:   1. You must sign up on the list with our KJ - Paul Woody (PDub). He is the ONLY person that can sign people up to sing. Watch for him to arrive and get your name on the list.  2. You must ALREADY have your song picked out when you ask Paul to sign you up - NO EXCEPTIONS.   3. Paul will announce 3 singers at a time: UP NEXT, ON DECK, and IN THE HOLE. When you are in the ON DECK position, you need to be at the stage BEFORE the current singer completes their song so you can go right up. We need you ready to go when it is your turn to avoid delays which takes singing time away. If you ARE NOT ready to take stage when it is your turn, you will lose your turn and will need ask to get back on the list (at the bottom). NO EXCEPTIONS!  3. DO NOT ask to be bumped up on the list - it will not happen. It is not fair to other singers who have been waiting their turn.  4. If you want to be put on the list again after you have sang, you can sign up immediately after completing your song ONLY.  5. A duet counts as one person\'s song. If a singer invites you up to sing a duet with them, that WILL NOT count as YOUR song, and you will keep your current place on the list.    It is BEST to arrive early to get your name on the list and get up as quickly as possible. That MAY improve your chance to sing again later in the evening, but is NOT a guarantee.',
