    Description: 'DesignArts \'16, an exhibition of Utah design, is now open at the Rio Gallery. A reception and celebration coinciding with Salt Lake Design Week and Salt Lake Gallery Stroll will be hosted in the gallery on Oct. 21 from 6-9 p.m.\r\n\r\nJuror Jim Childress selected 39 designs by 18 Utah designers ranging from lighting design to salt and pepper shakers. The juror\'s award winner in the professional category is Jessica Greenberg for her lighting design work with SB Dance and Off-Broadway Theater. There are two juror’s award winners in the student category: DesignBuildBLUFF for their “Cedar Hall” project in architecture and Jun Li’s architectural design concepts for five projects.',
