    Description: 'Arts & Culture Categories: * VISUAL ARTS, * CULTURAL\r\nAudience: Children,Teens,Adults,Members\r\nType of Event: Exhibit\r\nCost: Complimentary Admission\r\nContact: ECAC staff: 801-392-6935\r\nGallery Details: The Eccles Community Art Center, a Victorian sandstone mansion, exhibits work of local, regional, and nationally known artists.  The mansion houses the offices of the art center, the Junior League, Weber Artsand Rotary.  Other buildings in the complex hold studios for the arts and dance classes sponsored by the center, which are open to the public.An excellent sales/gift gallery, which represents over sixty local Northern Utah artists, is found in the carriage house.  Colorful gardenswith a growing collection of sculpture complete the center.  Gallery/office Hours: Weekdays 9 a.m. to 5 p.m. Saturdays 9 a.m. to 3 p.m.\r\nLink: http://www.ogden4arts.org\r\nAdrian Van Suchtelen and Robin L Farr in theMain Gallery and feature the art work of Tim Dorny Peterson, Sr. and the ceramic teapots of Victoria Acoba in the Carriage House Gallery during the month of October.  A reception for the artists will be held in association with Ogden\'s Art Stroll on Friday October 7, 2016 from 5 to 8p.m.  For more information about the center and its exhibits, please visit: www.ogden4arts.org.',
