    Description: 'In *Wait Here *Please, mixed media artist Lexi Rae Johnson uses multiple paintings and an installation of a mythological city called *Warm Land *to create an environment in which viewers can step into a portal of otherworldliness. Johnson says of her work, “Here, dogs will fight for you. Here, absurd corridors will unfold for you. Please allow me to introduce to impossible combinations.” Through her work, Johnson creates a space where viewers can forget their surroundings and become one with her created landscape.\r\n\r\n___\r\n\r\nJohnson will present a gallery talk on Friday, October 21 from 5:30-6:00 p.m.',
