    Description: 'Pioneer Theatre Company\'s Loge Gallery presents an exhibit of paintings by members of the Utah Watercolor Society. The collection will be on display during PTC\'s production of *The Glass Menagerie, *October 21 through November 5, 2016.\r\n\r\n___\r\n\r\nThe juried show hosted a reception at the theatre on Friday, October 7 to announce the winners. \r\n\r\n___\r\n\r\nIain Stewart was juror for the show. \r\n\r\n___\r\n\r\n**Best of Show **\r\n\r\n"Cliffside Oasis" \r\n\r\n**\r\n___\r\n**\r\n\r\n**Award of Excellence **\r\n\r\n"Dry Dock" \r\n\r\n"Mellow Yellow" \r\n\r\n**\r\n___\r\n**\r\n\r\n**Award of Merit **\r\n\r\n"Hiking Sunnyside" \r\n\r\n"Oranges & Lemons"  \r\n\r\n"Misty Morning Zion" \r\n\r\n**\r\n___\r\n**\r\n\r\n**Juror Award **\r\n\r\n"Jewess" \r\n\r\n"Heather\'s Braids"  \r\n\r\n"Pond Tour Again"  \r\n\r\n"Salt Lake Overlook" \r\n\r\n**\r\n___\r\n**\r\n\r\n**Past Presidents Award **\r\n\r\n"Morning Daisy" \r\n\r\n**\r\n___\r\n**\r\n\r\n**Merchant Award **\r\n\r\n"Paper Chase"  \r\n\r\n"Stopping to Smell the Roses"  \r\n\r\n"Umbilical"  \r\n\r\n"Out of the Woods" \r\n\r\n"Dusty, Muddy, Sunny" \r\n\r\n___\r\nRoland Lee\r\n___\r\n\r\n___\r\n\r\n___\r\nKristi Grussendorf\r\n___\r\nIrene Rampton\r\n___\r\n\r\n___\r\n\r\n___\r\nBarbara Kidd\r\n___\r\nKristi Grussendorf\r\n___\r\nRoland Lee\r\n___\r\n\r\n___\r\n\r\n___\r\nShelley Young\r\n___\r\n\r\nCrystal Dunn\r\n\r\nMary Pusey\r\n\r\nBarbara Kidd\r\n\r\n___\r\n\r\n___\r\n\r\nSandy Sleeper\r\n\r\n___\r\n\r\n___\r\n\r\nKazuko Hill\r\n\r\nLanning Porter\r\n\r\nKathy Sutherland\r\n\r\nLori D. Burchinal\r\n\r\nChariya Ernst',
