    Description: 'In *Wait Here *Please, mixed media artist Lexi Rae Johnson uses multiple paintings and an installation of a mythological city called *Warm Land *to create an environment in which viewers can step into a portal of otherworldliness. Johnson says of her work, “Here, dogs will fight for you. Here, absurd corridors will unfold for you. Please allow me to introduce you to impossible combinations.” Through her work, Johnson creates a space where viewers can forget their surroundings and become one with her created landscape. \r\n___\r\n\r\nVan der Wal and Johnson will present gallery talks about their work on Friday, October 21 with Benny van der Wal at 5:00 p.m. and Lexi Rae Johnson at 5:30 p.m.\r\n\r\nWhat:              Finch Lane Gallery Exhibition featuring artists:\r\n\r\nBenny van der Wal and Lexi Rae Johnson\r\n\r\nWhen:             September 30 through November 18\r\n\r\nWhere:           Finch Lane Gallery, 54 Finch Lane in Reservoir Park\r\n\r\nFinch Lane Gallery hours are Monday through Friday, 8:00 a.m. to 5:00 p.m. with additional evening hours during the Salt Lake City Gallery Stroll on October 21 and November 18 from 6:00 p.m. to 9:00 p.m. All events are free of charge. For additional information, contact the Salt Lake City Arts Council, 801.596.5000 or visit www.saltlakearts.org.',
