    Description: '**Mountain West Hard Cider **is a strong supporter of local businesses and artists! We are proud to participate in the October **Salt Lake Gallery Stroll**. This quarter, we are featuring artist **Jenni Thompson,** a third generation artist from Spring City, Utah.\r\n___\r\n\r\n___\r\n  Jenni\'s art is strongly influenced by her mother, M’lisa Paulsen, and  grandmother, Erla Young, as well as the construction mindlessness of her  father, Craig Paulsen. She loves angles and geometry looking at the  negative space that objects create. And, she readily admits a fetish for  red roofs.\r\n___\r\n\r\n___\r\n Jenni studied Fine Art and Painting at BYU (Brigham Young University) and The University of Utah.  She loves historic buildings and antiques. Jenni and her husband, Eric,  currently restored the oldest house in the Avenues, where they  currently reside. Jenni and Eric have two children, Finn and Maris, who  also love to paint with their grandma.\r\n___\r\n **\r\n___\r\n Visit Mountain West Hard Cider to meet artist Jenni Thompson and enjoy some hard cider! Join us for a free cider tasting until we close at 7:00pm.**',
