    Description: 'Karl Blau\r\n\r\nWatch\r\n\r\nLinks\r\n\r\nOn Introducing Karl Blau, released 13th May on Bella Union, the enigmatic vocalist charts a new vision of country music. A Northwest indie hero, Blau channels darkness and hope in a cinematic collection of Nashville country hits from the 60\'s and 70\'s. Produced by Tucker Martine, the record features performances by Jim James (My Morning Jacket), Laura Veirs, Jon Hyde, Eli Moore (Lake), Steve Moore (Earth, SunnO)))), among others.\r\n___\r\n\r\n___\r\nIt all started with cutting a 7" single, a cover of the 1969 Tom T. Hall hit "That\'s How I Got to Memphis". Blau, whom Martine had come to know from sessions with Laura Veirs among others, asked if he could try singing it. "I knew what a special artist Karl was, but I had no idea what a powerful interpreter of songs he was,\' Martine says. The collaboration, pairing Blau\'s deeply sonorous voice with Martine\'s warm, modern arrangements, recast the Nashville hit in a new light. "He was able to communicate the essence of the song in such a moving way that we started dreaming of making a whole record based around our excitement for that collaboration." The result was the single and, now, Introducing Karl Blau.\r\n___\r\n\r\n___\r\nMartine and Blau worked for years on shaping the narrative of the record. "I feel like I am starring in this country-western movie, written and produced by Tucker, and it tells a story," says Blau. A sense of emergence from the shadows of loss, loneliness, infidelity, and melancholy runs through Introducing Karl Blau. "We\'ve threaded a story through the record," says Blau. "My character is moving through this dark place, but there is always this light of hope."\r\n___\r\n\r\n___\r\nThe record, all covers, is a crate-digger\'s feast of forgotten hits and deeper cuts; most of them from the Nashville country-soul renaissance in the late 1960s and early 70s – Tom T. Hall, Bobby Bond, Allen Reynolds. Other songs are from the Bee Gees (To Love Somebody), Link Wray (Fallin\' Rain), or Townes Van Zandt (If I Needed You). The project was a labour of love for Martine, the son of a Nashville songwriter who grew up listening to many of these songs.\r\n___\r\n\r\n___\r\nAs for the title, Introducing Karl Blau, Martine says "In spite of Karl\'s prolific catalog of records I still feel that not nearly enough people have had the opportunity to hear this man. With any luck this album will help change that."\r\n___\r\n\r\n___\r\nKarl Blau is a multi-instrumentalist, singer, and DIY icon who helped turn his hometown of Anacortes, Washington, into an indie-music mecca. He has released more than 40 records in 20-odd years, many self-released in handmade packaging and mailed to subscribers, and others on iconic indie Northwest labels K and knw-yr-own. Blau has also toured and recorded for years with Laura Veirs, the Microphones, Little Wings, D+, and Earth.\r\n___\r\n\r\n___\r\nTucker Martine, known for his distinctive production work on music by My Morning Jacket, the Decemberists, and Laura Veirs, was first introduced to Blau\'s early music by Veirs. "I was transfixed by Karl\'s voice and completely absorbed by the world of sound he had created. I felt like I had been shown one of the great hidden treasures of music."\r\n\r\nLAKE\r\n\r\nLinks\r\n\r\nLAKE formed in Olympia, WA in 2005.\r\n___\r\n\r\n___\r\nMembers include Ashley Eriksson, Eli Moore, Markly Morrison, and Andrew Dorsett. Past members or collaborators include Lindsay Schief, Adam Oelsner, Paul Adam Benson, Micah Davis-Wheeler, Kenny Tarantino, and Karl Blau. \r\n___\r\n\r\n___\r\nTheir first album is self-titled, Lake, but is also known as Lake at the Department of Safety. Karl Blau recorded and produced this record at the local firehouse-turned artist-in-residence and creative space, Department of Safety in his hometown of Anacortes, WA. The sound of the album borrows from the band\'s wide influences of folk, bossa-nova, soft-rock, and Maher Shalal Hashbaz.\r\n___\r\n\r\n___\r\nLAKE\'s next release, Cassette, was home-recorded in Olympia with help from Portland band, Typhoon. These recordings were originally demos were intended for a recording session with producer, Tucker Martine, but the recordings turned out so great, the band self-released it as a cassette e.p. Over the course of the next two years, LAKE recorded sporadically with Tucker at his home studio in Portland, but the final product has been put in the vaults for now, waiting to be released. Cassette was eventually turned into a full-length album with additional songs from the sessions, through Funkytonk.\r\n___\r\n\r\n___\r\nNext the band speed-recorded and self-released a dancy, up-beat album, Oh, The Places We\'ll Go. While touring their album in Europe, the band got word that K Records was interested in releasing Oh, The Places We\'ll Go, thus would begin their relationship to release the next three albums, Let\'s Build A Roof, Giving and Receiving, and The World is Real .\r\n___\r\n\r\n___\r\nIn 2009 LAKE entered Dub Narcotic Studio at K Records to record another album with Karl Blau a, Let\'s Build A Roof. Following the album\'s release, the band toured with Karl in the US and Europe for the "Let\'s Build a Zebra" tour. Recorded by Calvin Johnson at Dub Narcotic, and mixed by Karl Blau, Giving and Receiving was laid to tape which began to disintegrate, and in effort to save the fruits of their labor, it was transferred to digital, a first for LAKE.\r\n___\r\n\r\n___\r\nIn the fall of 2012 Ashley and Eli toured Japan, where they began selling a cassette called Avocado, compiled of outtakes and alternate cuts of songs spanning their career. It contained an alternate version of "Christmas Island" which originally appeared on Let\'s Build A Roof, and is featured on the Cartoon Network show Adventure Time.\r\n___\r\n\r\n___\r\nIn 2013, LAKE released The World is Real, on K-Records. Recorded with the help of Ben Hargett, the album is the last with founding member Lindsay Schief. A short time later, the band recorded yet another album with Karl Blau, in Anacortes, at the Unknown studio. Circular Doorway was also released in 2013.\r\n___\r\n\r\n___\r\nLAKE has a rich history of collaboration and have toured extensively throughout the U.S., Europe, and Japan with Laura Veirs, Adrian Orange, Half-handed Cloud, Ages & Ages, Desolation Wilderness, Karl Blau, Ever-ending Kicks, Wye Oak, 4 Bonjour Parties, and R. Stevie Moore.',
